Файл с исходным текстом на Java называют компилируемым модулем. Имя каждого компилируемого модуля должно завершаться суффиксом .java. Внутри компилируемого модуля должен находиться открытый класс, имеющий то же имя, что и файл. Любой компилируемый модуль не может содержать более одного открытого класса. В результате компиляции для каждого класса, определенного в исходном файле, создается класс с тем же именем, но с расширением .class. Имена членов классов изолируются друг от друга. Например, метод f() класса A не конфликтует с методом f() с таким же списком аргументов класса B. Для предотвращения конфликтов имен классов используют механизм импортирования. Он обеспечивает возможность управления пространством имен. Механизм импортирования основан на совместном использовании директив package и import. Для указания связи между отдельными компонентами (хранящихся в отдельных файлах *.java и *.class) используют ключевое слово package. Директива package должна находиться в первой незакомментированной строке файла. Например: package access; указывает, что открытый класс в этом компилируемом модуле принадлежит имени access. Доступ к нему будет осуществляться по полному имени или с помощью директивы import. Имена пакетов записываются только строчными буквами.
access/mypackage/MyClass.java:
package access.mypackage;
public class MyClass {
//...
}
access/ImportedMyClass.java:
import access.mypackage.
*;
public class ImportedMyClass {
 public static void main(String[] args) {
 MyClass m = new MyClass();
 }
}
Создание пакета всегда неявно сопряжено с определением структуры каталогов. Пакет обязан находиться в одноименном каталоге. «Имя пакета ‒ его каталог» Размещение файлов пакета в отдельном каталоге решает две задачи:
• создание уникальных имен;
• обнаружение классов интерпретатором.

Конфликты имен.

Например, программа содержит следующие директивы:
import ru.tstu.sapr.
*;
