ru.tstu.sapr.Random rnd1;
java.util.Random rnd2;
rnd1 = new ru.tstu.sapr.Random();
rnd2 = new java.util.Random();

Спецификаторы доступа.

Для классов применяются:
• общий доступ (public);
• доступ по умолчанию (без ключевого слова).
Для членов классов применяются:
• общий доступ (public);
• доступ по умолчанию (без ключевого слова);
• скрытый доступ (private);
• защищенный доступ (protected).
Доступ по умолчанию также называют доступом в пределах пакета (package access). Класс (поле класса, метод класса) доступен для всех остальных классов текущего пакета. Для классов за пределами пакета он воспринимается как скрытый. Доступ в пределах пакета позволяет группировать взаимосвязанные классы в одном пакете. Размещая классы в одном пакете, разработчик получает полный контроль над кодом пакета.
